You asked for it! Here’s how I achieve the perfect cat eye using only a few products and a pointed Q-tip! List of products and techniques below 💋

Song - Juju @shirazee & @saintjhn 
@urbandecaycosmetics Naked Honey Pallet - I first applied a base on the lid with shade ‘Sweet’ then added a little of ‘Swarm’ to the outer corner and just under the bottom lashes to extend the eye shape and open the eye. Lastly I applied ‘Golden’ over the full lid and added a little to the corners for a pop. 
@benefitcosmetics Roller Liner Shade ‘Brown’ - I often use black but when doing a more natural look I love the brown liner because it’s less dramatic. The trick to getting a good straight line is to lean the felt tip on its side and drag it across starting at the outer edge of your eye. You want to make it straight so just relax your eye lid -don’t squint. Once u get the wing at the right spot then u can start to bring the line across your lash line to the middle then flip the liner around and drag the opposite way from inside corner to meet in the middle. Sometimes if my hand is too shaky I’ll just do little strokes at a time then go back over it when the shape is right. 
The key is to have a pointed Q-Tip to clean it up so the line is perfect and end is sharp!

@tatcha Pure One Step Camellia Cleansing Oil - I use a little pump on the Q-tip to erase any mistakes and the make the wing sharp. 
@benefitcosmetics Bad Gal Mascara 
@kkwbeauty Nude 2 Lip Liner & Nude 5 Lipstick
